import { INCREMENT } from '../actions/index';
import { DECREMENT } from '../actions';

const initialState = {count: 0};

export default (state = initialState, action) => {
  switch (action.type) {
    case INCREMENT:
      return{count: state.conut + 1}
    case DECREMENT:
      return {count: state.count - 1}
    default:
      return state
  }
}
